    "s-v-family-affairs-obs",nt"isopen": false,nt"url": null,nt"notes":
    "Marine debris degrades ocean habitats, endangers marine and coastal wildlife,
    causes navigation hazards, results in economic losses to industry and governments,
    and threatens human health and safety. EPA Pacific Southwest (Region 9) is tapping
    existing programs and resources to advance the prevention, reduction and clean-up
    of marine debris in the North Pacific Ocean. EPA Pacific Southwest activities build
    upon specific recommendations of the Interagency Marine Debris Coordinating Committee
    by targeting threats and sources of debris and responding to debris impacts. EPA
    is initiating a three-pronged effort to reduce sources of marine debris, prevent
    trash from entering the oceans, and assess the human and ecosystem impacts and potential
    for cleanup.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
